import React from "react";
import {Row, Col, CardGroup, CardBody, CardTitle, Card, Table, FormGroup, Label, Input, CardColumns, CardDeck} from "reactstrap";

const card = (workout) => {
    return (
        <Card className={'mb-4'}>
            <CardTitle>{workout.name}</CardTitle>
            <CardBody>
                <Table>
                    <thead>
                    <tr>
                        <th>Exercise</th>
                        <th>Reps</th>
                        <th>Sets</th>
                        <th>Achieved</th>
                    </tr>
                    </thead>
                    <tbody>
                    {workout.exercises.map(e =>
                        <tr>
                            <td>{e.name}</td>
                            <td>{e.reps}</td>
                            <td>{e.sets}</td>
                            <td>{<FormGroup check style={{position: '20'}}>
                                    <Label check>
                                        <Input type="checkbox">Achieved</Input>
                                    </Label>
                                </FormGroup>}</td>
                        </tr>)}
                    </tbody>

                </Table>

            </CardBody>
        </Card>
    )

}

const windowInnerWidth = window.innerWidth;
console.log(windowInnerWidth)

const WorkoutWeekTable = ({workouts}) => {
    return (
        <div>
            {workouts.map(workout => card(workout))}
        </div>
    )
};

export default WorkoutWeekTable;
